import React from 'react';

import img1 from '../../img/card1.png';
import img2 from '../../img/card2.png';
import img3 from '../../img/card3.png';

const data = [
    {
        key: "Card 1",
        price: "Starting from PKR 3.00",
        dis:"Finish Options Available",
        img: img1
    },
    {
        key: "Card 2",
        price: "Starting from PKR 3.00",
        dis:"Finish Options Available",
        img: img2
    },
    {
        key: "Card 3",
        price: "Starting from PKR 3.00",
        dis:"Finish Options Available",
        img: img3
    },
]


export default data;
